def _split_op_result(self, result) -> List['Block']:
    if is_extension_array_dtype(result) and result.ndim > 1:
        nbs = []
        for i, loc in enumerate(self.mgr_locs):
            vals = result[i]
            block = self.make_block(values=vals, placement=[loc])
            nbs.append(block)
        return nbs
    if not isinstance(result, Block):
        result = self.make_block(result)
    return [result]

def fillna(self, value, limit=None, inplace: bool=False, downcast=None) -> List['Block']:
    """
    fillna on the block with the value. If we fail, then convert to
    ObjectBlock and try again
    """
    inplace = validate_bool_kwarg(inplace, 'inplace')
    mask = isna(self.values)
    if limit is not None:
        limit = libalgos._validate_limit(None, limit=limit)
        mask[mask.cumsum(self.ndim - 1) > limit] = False
    if not self._can_hold_na:
        if inplace:
            return [self]
        else:
            return [self.copy()]
    if self._can_hold_element(value):
        blocks = self.putmask(mask, value, inplace=inplace)
        return self._maybe_downcast(blocks, downcast)
    if not mask.any():
        return [self] if inplace else [self.copy()]

    def f(mask, val, idx):
        block = self.coerce_to_target_dtype(value)
        if idx is not None:
            block = block.getitem_block(slice(idx, idx + 1))
        return block.fillna(value, limit=limit, inplace=inplace, downcast=None)
    return self.split_and_operate(None, f, inplace)

def _maybe_downcast(self, blocks: List['Block'], downcast=None) -> List['Block']:
    if downcast is None and (self.is_float or self.is_timedelta or self.is_datetime):
        return blocks
    return _extend_blocks([b.downcast(downcast) for b in blocks])

def downcast(self, dtypes=None):
    """ try to downcast each item to the dict of dtypes if present """
    if dtypes is False:
        return self
    values = self.values
    if self._is_single_block:
        if dtypes is None:
            dtypes = 'infer'
        nv = maybe_downcast_to_dtype(values, dtypes)
        return self.make_block(nv)
    if dtypes is None:
        return self
    if not (dtypes == 'infer' or isinstance(dtypes, dict)):
        raise ValueError("downcast must have a dictionary or 'infer' as its argument")
    elif dtypes != 'infer':
        raise AssertionError('dtypes as dict is not supported yet')

    def f(mask, val, idx):
        val = maybe_downcast_to_dtype(val, dtype='infer')
        return val
    return self.split_and_operate(None, f, False)

def astype(self, dtype, copy: bool=False, errors: str='raise'):
    """
    Coerce to the new dtype.

    Parameters
    ----------
    dtype : str, dtype convertible
    copy : bool, default False
        copy if indicated
    errors : str, {'raise', 'ignore'}, default 'ignore'
        - ``raise`` : allow exceptions to be raised
        - ``ignore`` : suppress exceptions. On error return original object

    Returns
    -------
    Block
    """
    errors_legal_values = ('raise', 'ignore')
    if errors not in errors_legal_values:
        invalid_arg = f"Expected value of kwarg 'errors' to be one of {list(errors_legal_values)}. Supplied value is '{errors}'"
        raise ValueError(invalid_arg)
    if inspect.isclass(dtype) and issubclass(dtype, ExtensionDtype):
        msg = f"Expected an instance of {dtype.__name__}, but got the class instead. Try instantiating 'dtype'."
        raise TypeError(msg)
    if dtype is not None:
        dtype = pandas_dtype(dtype)
    if is_categorical_dtype(dtype):
        if is_categorical_dtype(self.values.dtype):
            return self.make_block(self.values.astype(dtype, copy=copy))
        return self.make_block(Categorical(self.values, dtype=dtype))
    dtype = pandas_dtype(dtype)
    if is_dtype_equal(self.dtype, dtype):
        if copy:
            return self.copy()
        return self
    if self.is_extension:
        values = self.values.astype(dtype)
    else:
        if issubclass(dtype.type, str):
            if self.is_datelike:
                values = self.to_native_types()
            else:
                values = self.values
        else:
            values = self.get_values(dtype=dtype)
        vals1d = values.ravel()
        try:
            values = astype_nansafe(vals1d, dtype, copy=True)
        except (ValueError, TypeError):
            if errors == 'raise':
                raise
            newb = self.copy() if copy else self
            return newb
    if isinstance(values, np.ndarray):
        values = values.reshape(self.shape)
    newb = make_block(values, placement=self.mgr_locs, ndim=self.ndim)
    if newb.is_numeric and self.is_numeric:
        if newb.shape != self.shape:
            raise TypeError(f'cannot set astype for copy = [{copy}] for dtype ({self.dtype.name} [{self.shape}]) to different shape ({newb.dtype.name} [{newb.shape}])')
    return newb

def _can_hold_element(self, element: Any) -> bool:
    """ require the same dtype as ourselves """
    dtype = self.values.dtype.type
    tipo = maybe_infer_dtype_type(element)
    if tipo is not None:
        return issubclass(tipo.type, dtype)
    return isinstance(element, dtype)

def to_native_types(self, na_rep='nan', quoting=None, **kwargs):
    """ convert to our native types format """
    values = self.values
    mask = isna(values)
    itemsize = writers.word_len(na_rep)
    if not self.is_object and (not quoting) and itemsize:
        values = values.astype(str)
        if values.dtype.itemsize / np.dtype('U1').itemsize < itemsize:
            values = values.astype(f'<U{itemsize}')
    else:
        values = np.array(values, dtype='object')
    values[mask] = na_rep
    return values

def copy(self, deep: bool=True):
    """ copy constructor """
    values = self.values
    if deep:
        values = values.copy()
    return self.make_block_same_class(values, ndim=self.ndim)

def replace(self, to_replace, value, inplace: bool=False, regex: bool=False, convert: bool=True):
    """
    replace the to_replace value with value, possible to create new
    blocks here this is just a call to putmask. regex is not used here.
    It is used in ObjectBlocks.  It is here for API compatibility.
    """
    inplace = validate_bool_kwarg(inplace, 'inplace')
    original_to_replace = to_replace
    if not self._can_hold_element(to_replace):
        if not isinstance(to_replace, list):
            if inplace:
                return [self]
            return [self.copy()]
        to_replace = [x for x in to_replace if self._can_hold_element(x)]
        if not len(to_replace):
            if inplace:
                return [self]
            return [self.copy()]
        if len(to_replace) == 1:
            return self.replace(to_replace[0], value, inplace=inplace, regex=regex, convert=convert)
        if is_object_dtype(self):
            raise AssertionError
        block = self.astype(object)
        return block.replace(to_replace=to_replace, value=value, inplace=inplace, regex=regex, convert=convert)
    values = self.values
    if lib.is_scalar(to_replace) and isinstance(values, np.ndarray):
        to_replace = convert_scalar_for_putitemlike(to_replace, values.dtype)
    mask = missing.mask_missing(values, to_replace)
    if not mask.any():
        if inplace:
            return [self]
        return [self.copy()]
    try:
        blocks = self.putmask(mask, value, inplace=inplace)
    except (TypeError, ValueError):
        if is_object_dtype(self):
            raise
        assert not self._can_hold_element(value), value
        block = self.astype(object)
        return block.replace(to_replace=original_to_replace, value=value, inplace=inplace, regex=regex, convert=convert)
    if convert:
        blocks = [b.convert(numeric=False, copy=not inplace) for b in blocks]
    return blocks

def _replace_single(self, *args, **kwargs):
    """ no-op on a non-ObjectBlock """
    return self if kwargs['inplace'] else self.copy()

def setitem(self, indexer, value):
    """
    Attempt self.values[indexer] = value, possibly creating a new array.

    Parameters
    ----------
    indexer : tuple, list-like, array-like, slice
        The subset of self.values to set
    value : object
        The value being set

    Returns
    -------
    Block

    Notes
    -----
    `indexer` is a direct slice/positional indexer. `value` must
    be a compatible shape.
    """
    transpose = self.ndim == 2
    if isinstance(indexer, np.ndarray) and indexer.ndim > self.ndim:
        raise ValueError(f'Cannot set values with ndim > {self.ndim}')
    if value is None:
        if self.is_numeric:
            value = np.nan
    values = self.values
    if self._can_hold_element(value):
        if lib.is_scalar(value):
            value = convert_scalar_for_putitemlike(value, values.dtype)
    else:
        if hasattr(value, 'dtype'):
            dtype = value.dtype
        elif lib.is_scalar(value) and (not isna(value)):
            dtype, _ = infer_dtype_from_scalar(value, pandas_dtype=True)
        else:
            dtype, _ = maybe_promote(np.array(value).dtype)
            return self.astype(dtype).setitem(indexer, value)
        dtype = find_common_type([values.dtype, dtype])
        assert not is_dtype_equal(self.dtype, dtype)
        return self.astype(dtype).setitem(indexer, value)
    if is_extension_array_dtype(getattr(value, 'dtype', None)):
        arr_value = value
    else:
        arr_value = np.array(value)
    if transpose:
        values = values.T
    check_setitem_lengths(indexer, value, values)
    exact_match = len(arr_value.shape) and arr_value.shape[0] == values.shape[0] and (arr_value.size == values.size)
    if is_empty_indexer(indexer, arr_value):
        pass
    elif is_scalar_indexer(indexer, self.ndim):
        values[indexer] = value
    elif exact_match and is_categorical_dtype(arr_value.dtype):
        values[indexer] = value
        return self.make_block(Categorical(self.values, dtype=arr_value.dtype))
    elif exact_match:
        values[indexer] = value
        values = values.astype(arr_value.dtype, copy=False)
    else:
        values[indexer] = value
    if transpose:
        values = values.T
    block = self.make_block(values)
    return block

def putmask(self, mask, new, inplace: bool=False, axis: int=0, transpose: bool=False) -> List['Block']:
    """
    putmask the data to the block; it is possible that we may create a
    new dtype of block

    Return the resulting block(s).

    Parameters
    ----------
    mask : np.ndarray[bool], SparseArray[bool], or BooleanArray
    new : a ndarray/object
    inplace : bool, default False
        Perform inplace modification.
    axis : int
    transpose : bool, default False
        Set to True if self is stored with axes reversed.

    Returns
    -------
    List[Block]
    """
    mask = _extract_bool_array(mask)
    assert not isinstance(new, (ABCIndexClass, ABCSeries, ABCDataFrame))
    new_values = self.values if inplace else self.values.copy()
    if not is_list_like(new) and isna(new) and (not self.is_object):
        new = self.fill_value
    if self._can_hold_element(new):
        if lib.is_scalar(new):
            new = convert_scalar_for_putitemlike(new, new_values.dtype)
        if transpose:
            new_values = new_values.T
        if getattr(new, 'ndim', 0) >= 1:
            if self.ndim - 1 == new.ndim and axis == 1:
                new = np.repeat(new, new_values.shape[-1]).reshape(self.shape)
            new = new.astype(new_values.dtype)
        if is_list_like(new) and np.any(mask[mask]) and (getattr(new, 'ndim', 1) == 1):
            if mask[mask].shape[-1] == len(new):
                np.place(new_values, mask, new)
            elif mask.shape[-1] == len(new) or len(new) == 1:
                np.putmask(new_values, mask, new)
            else:
                raise ValueError('cannot assign mismatch length to masked array')
        else:
            np.putmask(new_values, mask, new)
    elif mask.any():
        if transpose:
            mask = mask.T
            if isinstance(new, np.ndarray):
                new = new.T
            axis = new_values.ndim - axis - 1
        if getattr(new, 'ndim', 0) >= 1:
            if self.ndim - 1 == new.ndim:
                new_shape = list(new.shape)
                new_shape.insert(axis, 1)
                new = new.reshape(tuple(new_shape))

        def f(mask, val, idx):
            if idx is None:
                n = new
            else:
                if isinstance(new, np.ndarray):
                    n = np.squeeze(new[idx % new.shape[0]])
                else:
                    n = np.array(new)
                dtype, _ = maybe_promote(n.dtype)
                n = n.astype(dtype)
            nv = _putmask_smart(val, mask, n)
            return nv
        new_blocks = self.split_and_operate(mask, f, inplace)
        return new_blocks
    if inplace:
        return [self]
    if transpose:
        new_values = new_values.T
    return [self.make_block(new_values)]

def coerce_to_target_dtype(self, other):
    """
    coerce the current block to a dtype compat for other
    we will return a block, possibly object, and not raise

    we can also safely try to coerce to the same dtype
    and will receive the same block
    """
    dtype, _ = infer_dtype_from(other, pandas_dtype=True)
    if is_dtype_equal(self.dtype, dtype):
        return self
    if self.is_bool or is_object_dtype(dtype) or is_bool_dtype(dtype):
        return self.astype(object)
    elif (self.is_float or self.is_complex) and (is_integer_dtype(dtype) or is_float_dtype(dtype)):
        return self
    elif self.is_datetime or is_datetime64_dtype(dtype) or is_datetime64tz_dtype(dtype):
        if not ((is_datetime64_dtype(dtype) or is_datetime64tz_dtype(dtype)) and self.is_datetime):
            return self.astype(object)
        mytz = getattr(self.dtype, 'tz', None)
        othertz = getattr(dtype, 'tz', None)
        if not tz_compare(mytz, othertz):
            return self.astype(object)
        raise AssertionError(f'possible recursion in coerce_to_target_dtype: {self} {other}')
    elif self.is_timedelta or is_timedelta64_dtype(dtype):
        if not (is_timedelta64_dtype(dtype) and self.is_timedelta):
            return self.astype(object)
        raise AssertionError(f'possible recursion in coerce_to_target_dtype: {self} {other}')
    try:
        return self.astype(dtype)
    except (ValueError, TypeError, OverflowError):
        return self.astype(object)

def interpolate(self, method='pad', axis=0, index=None, inplace=False, limit=None, limit_direction='forward', limit_area=None, fill_value=None, coerce=False, downcast=None, **kwargs):
    inplace = validate_bool_kwarg(inplace, 'inplace')

    def check_int_bool(self, inplace):
        if (self.is_bool or self.is_integer) and (not self.is_timedelta):
            if inplace:
                return self
            else:
                return self.copy()
    try:
        m = missing.clean_fill_method(method)
    except ValueError:
        m = None
    if m is not None:
        r = check_int_bool(self, inplace)
        if r is not None:
            return r
        return self._interpolate_with_fill(method=m, axis=axis, inplace=inplace, limit=limit, fill_value=fill_value, coerce=coerce, downcast=downcast)
    m = missing.clean_interp_method(method, **kwargs)
    r = check_int_bool(self, inplace)
    if r is not None:
        return r
    return self._interpolate(method=m, index=index, axis=axis, limit=limit, limit_direction=limit_direction, limit_area=limit_area, fill_value=fill_value, inplace=inplace, downcast=downcast, **kwargs)

def _interpolate_with_fill(self, method='pad', axis=0, inplace=False, limit=None, fill_value=None, coerce=False, downcast=None) -> List['Block']:
    """ fillna but using the interpolate machinery """
    inplace = validate_bool_kwarg(inplace, 'inplace')
    if coerce:
        if not self._can_hold_na:
            if inplace:
                return [self]
            else:
                return [self.copy()]
    values = self.values if inplace else self.values.copy()
    fill_value = convert_scalar_for_putitemlike(fill_value, self.values.dtype)
    values = missing.interpolate_2d(values, method=method, axis=axis, limit=limit, fill_value=fill_value, dtype=self.dtype)
    blocks = [self.make_block_same_class(values, ndim=self.ndim)]
    return self._maybe_downcast(blocks, downcast)

def _interpolate(self, method=None, index=None, fill_value=None, axis=0, limit=None, limit_direction='forward', limit_area=None, inplace=False, downcast=None, **kwargs) -> List['Block']:
    """ interpolate using scipy wrappers """
    inplace = validate_bool_kwarg(inplace, 'inplace')
    data = self.values if inplace else self.values.copy()
    if not self.is_float:
        if not self.is_integer:
            return [self]
        data = data.astype(np.float64)
    if fill_value is None:
        fill_value = self.fill_value
    if method in ('krogh', 'piecewise_polynomial', 'pchip'):
        if not index.is_monotonic:
            raise ValueError(f'{method} interpolation requires that the index be monotonic.')

    def func(x):
        return missing.interpolate_1d(index, x, method=method, limit=limit, limit_direction=limit_direction, limit_area=limit_area, fill_value=fill_value, bounds_error=False, **kwargs)
    interp_values = np.apply_along_axis(func, axis, data)
    blocks = [self.make_block_same_class(interp_values)]
    return self._maybe_downcast(blocks, downcast)

def take_nd(self, indexer, axis: int, new_mgr_locs=None, fill_value=lib.no_default):
    """
    Take values according to indexer and return them as a block.bb

    """
    values = self.values
    if fill_value is lib.no_default:
        fill_value = self.fill_value
        allow_fill = False
    else:
        allow_fill = True
    new_values = algos.take_nd(values, indexer, axis=axis, allow_fill=allow_fill, fill_value=fill_value)
    assert not (axis == 0 and new_mgr_locs is None)
    if new_mgr_locs is None:
        new_mgr_locs = self.mgr_locs
    if not is_dtype_equal(new_values.dtype, self.dtype):
        return self.make_block(new_values, new_mgr_locs)
    else:
        return self.make_block_same_class(new_values, new_mgr_locs)

def where(self, other, cond, errors='raise', try_cast: bool=False, axis: int=0) -> List['Block']:
    """
    evaluate the block; return result block(s) from the result

    Parameters
    ----------
    other : a ndarray/object
    cond : np.ndarray[bool], SparseArray[bool], or BooleanArray
    errors : str, {'raise', 'ignore'}, default 'raise'
        - ``raise`` : allow exceptions to be raised
        - ``ignore`` : suppress exceptions. On error return original object
    axis : int, default 0

    Returns
    -------
    List[Block]
    """
    import pandas.core.computation.expressions as expressions
    cond = _extract_bool_array(cond)
    assert not isinstance(other, (ABCIndexClass, ABCSeries, ABCDataFrame))
    assert errors in ['raise', 'ignore']
    transpose = self.ndim == 2
    values = self.values
    orig_other = other
    if transpose:
        values = values.T
    if getattr(other, 'ndim', 0) >= 1:
        if values.ndim - 1 == other.ndim and axis == 1:
            other = other.reshape(tuple(other.shape + (1,)))
        elif transpose and values.ndim == self.ndim - 1:
            cond = cond.T
    if not hasattr(cond, 'shape'):
        raise ValueError('where must have a condition that is ndarray like')

    def where_func(cond, values, other):
        if not ((self.is_integer or self.is_bool) and lib.is_float(other) and np.isnan(other)):
            if not self._can_hold_element(other):
                raise TypeError
            if lib.is_scalar(other) and isinstance(values, np.ndarray):
                other = convert_scalar_for_putitemlike(other, values.dtype)
        fastres = expressions.where(cond, values, other)
        return fastres
    if cond.ravel().all():
        result = values
    else:
        try:
            result = where_func(cond, values, other)
        except TypeError:
            block = self.coerce_to_target_dtype(other)
            blocks = block.where(orig_other, cond, errors=errors, try_cast=try_cast, axis=axis)
            return self._maybe_downcast(blocks, 'infer')
    if self._can_hold_na or self.ndim == 1:
        if transpose:
            result = result.T
        return [self.make_block(result)]
    axis = cond.ndim - 1
    cond = cond.swapaxes(axis, 0)
    mask = np.array([cond[i].all() for i in range(cond.shape[0])], dtype=bool)
    result_blocks = []
    for m in [mask, ~mask]:
